import React, { Component } from 'react'
import './App.css'

class App extends Component {
  render () {
    return (
      <div className="container">
        <div className="row">
          <div className="col-sm-6">
            Hello
          </div>
          <div className="col-sm-6">
            Bonjour
          </div>
        </div>
      </div>
    )
  }
}

export default App
